--
-- Name: guarda_in_cat(integer, integer, text); Type: FUNCTION; Schema: public; Owner: catalogousr
--

CREATE FUNCTION public.guarda_in_cat(integer, integer, text) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
DECLARE
	MENOR ALIAS FOR $1;
	MAYOR ALIAS FOR $2;
	NAME_CATALOGO ALIAS FOR $3;
--	insertvalue text;
BEGIN 
	WHILE MENOR <= MAYOR LOOP	 	
	 	--insertvalue := concat(MENOR, NAME_CATALOGO);
		--perform exec(concat(''INSERT INTO '', NAME_CATALOGO,'' VALUES('',MENOR,'','''''',insertvalue,'''''',1, now());''));
		EXECUTE(concat('INSERT INTO ', NAME_CATALOGO,' VALUES(',MENOR,',''',concat(MENOR, NAME_CATALOGO),''',1, now());'));
		MENOR = MENOR+1;
	END LOOP;
	RETURN MENOR ;
END;$_$;


ALTER FUNCTION public.guarda_in_cat(integer, integer, text) OWNER TO catalogousr;

--
-- Name: guarda_in_cat(integer, integer, character varying); Type: FUNCTION; Schema: public; Owner: catalogousr
--

CREATE FUNCTION public.guarda_in_cat(integer, integer, name_catalogo character varying) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
DECLARE
	MENOR ALIAS FOR $1;
	MAYOR ALIAS FOR $2;
BEGIN 
	 WHILE MENOR != MAYOR LOOP
		MENOR = MENOR+1;
	END LOOP;
	RETURN MENOR ;
END;$_$;


ALTER FUNCTION public.guarda_in_cat(integer, integer, name_catalogo character varying) OWNER TO catalogousr;

--
-- Name: guarda_in_cat_prueba(integer, integer, text, integer); Type: FUNCTION; Schema: public; Owner: catalogousr
--

CREATE FUNCTION public.guarda_in_cat_prueba(integer, integer, text, integer) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
DECLARE
	MENOR ALIAS FOR $1;
	MAYOR ALIAS FOR $2;
	NAME_CATALOGO ALIAS FOR $3;
	ACTIVO_INACTIVO_OTRO ALIAS FOR $4;
--	insertvalue text;
BEGIN 
	WHILE MENOR <= MAYOR LOOP	 	
	 	--insertvalue := concat(MENOR, NAME_CATALOGO);
		--perform exec(concat(''INSERT INTO '', NAME_CATALOGO,'' VALUES('',MENOR,'','''''',insertvalue,'''''',1, now());''));
		EXECUTE(concat('INSERT INTO ', NAME_CATALOGO,' VALUES(',MENOR,',''',concat(MENOR, NAME_CATALOGO),''',''',ACTIVO_INACTIVO_OTRO,''', now());'));
		MENOR = MENOR+2;
	END LOOP;
	RETURN MENOR ;
END;$_$;


